    established by the Commission.  All original solicitations contain the appropriate
    disclaimers and we follow up where necessary within 30 days, with a SASE that
    does not request another contribution, to obtain the missing information.  Finally,
    we do amend reports when additional information is received after the original
    filing.  Please find all of the new information we have received since the original
    filing for this report.  Our committee will continue to honor this practice.  To
    address the second point in the letter, please find the name, address, amount,
    purpose, state, office sought, and district of the candidates to whom we made
    contributions.  This information is present for all federal candidates, the others
    are contributions to state or local candidates.  Please contact us if any further
    information is needed.  Thank you, Gingrey for Congress."'
